from typing import TypedDict, List, Unionfrom langchain_core.messages import HumanMessage, AIMessagefrom langchain_openai import ChatOpenAIfrom langgraph.graph import StateGraph, END, STARTfrom dotenv import load_dotenvload_dotenv()# AgentState objectclass AgentState(TypedDict):    messages: List[Union[HumanMessage, AIMessage]]llm = ChatOpenAI(model="gpt-5-mini")def process(state: AgentState) -> AgentState:    response = llm.invoke(state['messages'])    state['messages'].append(AIMessage(content=response.content))    print(f"\nAI: {response.content}")    return state# Graph elements structuringgraph = StateGraph(AgentState)graph.add_node("process", process)graph.add_edge(START, "process")graph.add_edge("process", END)agent = graph.compile()conversation_history = []user_input = input("Enter: ")while user_input != "exit":    conversation_history.append(HumanMessage(content=user_input))    result = agent.invoke({            "messages": conversation_history    })    user_input = input("Enter: ")#print(agent.get_graph().draw_ascii())      # Visualize graphprint(conversation_history)